import React from "react";
import Navbar from "./Navbar";
import { Route, Routes } from "react-router-dom";

const AdminPortal = () => {
  return (
    <div>
        <Navbar/>
        <Routes>
            <Route el/>
        </Routes>
    </div>
  );
};

export default AdminPortal;
